import sys
import serial
import serial.tools.list_ports
from PyQt5 import QtCore, QtGui, QtWidgets
from PyQt5.QtWidgets import QMainWindow, QPushButton, QTableWidget, QTableWidgetItem
from generated_ui import Ui_MainWindow
from PyQt5.QtWidgets import QDialog, QLabel, QVBoxLayout, QPushButton, QLineEdit, QComboBox , QMessageBox, QRadioButton, QHBoxLayout, QTextEdit
from PyQt5.QtGui import QFont, QColor
from PyQt5.QtCore import QTimer  
import time,base64

class SerialMonitorApp(QMainWindow, Ui_MainWindow):
    def __init__(self):
        super().__init__()
        self.setupUi(self) 

        self.serial_port = None
        self.format_mode = "string"
        self.data_bits_mapping = {"5": serial.FIVEBITS, "6": serial.SIXBITS, "7": serial.SEVENBITS, "8": serial.EIGHTBITS}
        self.parity_mapping = {
            "No Parity": serial.PARITY_NONE,
            "Even Parity": serial.PARITY_EVEN,
            "Odd Parity": serial.PARITY_ODD 
        }
        self.stop_bits_mapping = {
            "1": serial.STOPBITS_ONE,
            "1.5": serial.STOPBITS_ONE_POINT_FIVE,
            "2": serial.STOPBITS_TWO
        }

        # Connect the push buttons using clicked.connect
        self.pushButton.clicked.connect(self.connect_serial)
        self.pushButton_2.clicked.connect(self.refresh_ports)
        self.pushButton_3.clicked.connect(self.clear_response)
        self.pushButton_4.clicked.connect(self.disconnect_serial)
        # self.pushButton_5.clicked.connect(self.submit_command)
        # self.pushButton_6.clicked.connect(self.send_version_command)
        # self.pushButton_7.clicked.connect(self.show_popup)

        self.setup_combo_boxes()
        self.setup_checkboxes()
        self.setup_additional_ui()

        self.output_format = "string"
        self.update_ports()

    def setup_combo_boxes(self): 

        self.comboBox_3.hide()
        self.comboBox_4.hide()
        self.comboBox_5.hide()
        self.comboBox_6.hide()
        self.comboBox_7.hide()

        base64_data = "data:image/png;base64,"

        base64_data = base64_data.split(",")[1]

        # Fix the padding issue if necessary
        missing_padding = len(base64_data) % 4
        if missing_padding != 0:
            base64_data += '=' * (4 - missing_padding)

        # Decode the base64 string to bytes
        image_data = base64.b64decode(base64_data)

        # Convert the bytes to a QPixmap
        pixmap = QtGui.QPixmap()
        pixmap.loadFromData(image_data)

        # Create the QLabel and set the QPixmap
        self.imageLabel = QtWidgets.QLabel(self.centralwidget)
        self.imageLabel.setGeometry(QtCore.QRect(10, 10, 200, 120))  # Adjust the size and position as needed
        self.imageLabel.setPixmap(pixmap)  # Use the QPixmap created from base64
        self.imageLabel.setScaledContents(True)
        self.imageLabel.setObjectName("imageLabel")

        self.comboBox_19.addItems([str(i) for i in range(1, 1001)])
        self.comboBox_3.addItems(["String", "Hex"]) 
        self.comboBox_4.addItems(self.data_bits_mapping.keys())
        self.comboBox_5.addItems(self.parity_mapping.keys())
        self.comboBox_6.addItems(self.stop_bits_mapping.keys())
        self.comboBox_7.addItems(["String","Hex","Chart"])
        self.comboBox_8.addItems(["Yes","No"])
        self.comboBox_9.addItems([""])  # sleep time dropdown
        self.comboBox_10.addItems([""])      #sensor type
        self.comboBox_11.addItems([str(i) for i in range(1, 1001)])
        self.comboBox_12.addItems([str(i) for i in range(1, 1001)])
        self.comboBox_13.addItems([str(i) for i in range(1, 22)])
        self.comboBox_14.addItems([""])     # temperature dropdown
        self.comboBox_18.addItems(["PT100","PT1000"])
        self.comboBox_15.addItems(["1","2","3","4"])

        self.comboBox_3.currentIndexChanged.connect(self.change_format_mode)
        self.comboBox_7.currentIndexChanged.connect(self.change_output_format)

    def disconnect_serial_port(self):  
        # Close the serial port if it is open  
        if self.serial_port and self.serial_port.is_open:  
            self.serial_port.close()  
            self.serial_port = None  
            print("Serial port disconnected.")
            
    def setup_checkboxes(self):
        self.checkBox.stateChanged.connect(self.on_carriage_return_changed)
        self.checkBox_2.stateChanged.connect(self.on_new_line_changed)

        self.checkBox.hide()
        self.checkBox_2.hide()

        self.append_r = True
        self.append_n = True

        self.checkBox.setChecked(True)
        self.checkBox_2.setChecked(True)

        self.output_format = "string"
        self.update_ports()
        self.update_baud_rates()

    def setup_additional_ui(self):
        self.pushButton_command = QPushButton(self.centralwidget)
        self.pushButton_command.setGeometry(QtCore.QRect(630, 213, 151, 32))
        self.pushButton_command.setObjectName("pushButton_command")
        self.pushButton_command.setText("Get Params")
        self.device_id = None
        self.version = None
        
        # Combine the styles into a single setStyleSheet call
        self.pushButton_command.setStyleSheet("""
            border: 2px solid #4CAF50;
            margin-right: 20px;
            border-radius: 10px;
            font-weight: bold;
            font-size: 14px;
            padding: 5px 10px;
            background-color: #4CAF50;
            color: white;
        """)
        
        self.pushButton_command.clicked.connect(self.set_default_values_and_send_command)

    def set_default_values_and_send_command(self):
        print("Setting default values and sending command")
        self.comboBox_3.setCurrentText("Hex")
        self.comboBox_4.setCurrentText("8")
        self.comboBox_5.setCurrentText("No Parity")
        self.comboBox_6.setCurrentText("1")
        self.comboBox_7.setCurrentText("Hex")

        self.checkBox.setChecked(False)
        self.checkBox_2.setChecked(False)

        self.disable_combo_boxes()
        self.send_command()

    def disable_combo_boxes(self):
        self.comboBox_3.setEnabled(False)
        self.comboBox_4.setEnabled(False)
        self.comboBox_5.setEnabled(False)
        self.comboBox_6.setEnabled(False)
        self.comboBox_7.setEnabled(False)
        self.checkBox.setEnabled(False)
        self.checkBox_2.setEnabled(False)

    def on_carriage_return_changed(self, state):
        print("Carriage return changed:", state)
        self.append_r = state == QtCore.Qt.Checked

    def on_new_line_changed(self, state):
        print("New line changed:", state)
        self.append_n = state == QtCore.Qt.Checked

    def update_baud_rates(self): #function to select baud rates
        baud_rates = ["9600"]  # Add more if needed
        self.comboBox_2.addItems(baud_rates)

    def disconnect_serial(self):  
        """Disconnects the serial port and updates the UI."""  
        print("Disconnecting serial port")  
        if self.serial_port and self.serial_port.is_open:  
            self.serial_port.close()  
            self.serial_port = None  
            self.textEdit_2.clear()  
            self.textEdit_2.append("Disconnected from serial port.")  
        else:  
            self.textEdit_2.append("No serial port is currently connected.")  
    
    def update_ports(self):  
        """Updates the list of available COM ports in the combo box."""  
        print("Updating ports")  
        self.comboBox.clear()  
        ports = serial.tools.list_ports.comports()  
        if ports:  
            self.comboBox.addItems([f"{port.device} - {port.description}" for port in ports])  
            print(f"Available ports: {[port.device for port in ports]}")  
        else:  
            self.comboBox.addItem("No ports available")  
            print("No COM ports found.")  

    def connect_serial(self):  
        """Connects to the selected serial port with specified parameters."""  
        print("Connecting to serial port")  
        if self.serial_port and self.serial_port.is_open:  
            self.serial_port.close()  
            self.serial_port = None  

        selected_port_info = self.comboBox.currentText()  
        selected_baud = int(self.comboBox_2.currentText())  
        selected_data_bits = self.get_selected_data_bits()  
        selected_parity = self.parity_mapping[self.comboBox_5.currentText()]  
        selected_stop_bits = self.get_selected_stop_bits()  

        try:  
            port_parts = selected_port_info.split(' - ')  
            if len(port_parts) == 2:  
                selected_port = port_parts[0]  
                self.serial_port = serial.Serial(  
                    port=selected_port,  
                    baudrate=selected_baud,  
                    bytesize=selected_data_bits,  
                    parity=selected_parity,  
                    stopbits=selected_stop_bits,  
                    timeout=1  
                )  
                self.textEdit_2.clear()  
                self.textEdit_2.append(f"Connected to {selected_port_info} at {selected_baud} baud.")  
                print(f"Successfully connected to {selected_port}.")  
            else:  
                raise ValueError("Invalid port format.")  
        except serial.SerialException as e:  
            self.textEdit_2.clear()  
            self.textEdit_2.append(f"Serial error: {str(e)}")  
            print(f"Serial error: {str(e)}")  
        except Exception as e:  
            self.textEdit_2.clear()  
            self.textEdit_2.append(f"Error: {str(e)}")  
            print(f"Error: {str(e)}")  

    def refresh_ports(self):  
        """Refreshes the list of available COM ports."""  
        print("Refreshing ports")  
        self.update_ports()  

    def clear_response(self):
        print("Clearing response text edit")
        self.textEdit_2.clear()

    def change_format_mode(self):
        selected_index = self.comboBox_3.currentIndex()
        print("Changing format mode to:", self.comboBox_3.currentText())
        self.format_mode = "string" if selected_index == 0 else "hex"

    def get_selected_data_bits(self):
        selected_data_bits = self.data_bits_mapping[self.comboBox_4.currentText()]
        print("Selected data bits:", selected_data_bits)
        return selected_data_bits

    def get_selected_stop_bits(self):
        selected_stop_bits = self.stop_bits_mapping[self.comboBox_6.currentText()]
        print("Selected stop bits:", selected_stop_bits)
        return selected_stop_bits

    def change_output_format(self):
        selected_index = self.comboBox_7.currentIndex()
        print("Changing output format to:", self.comboBox_7.currentText())
        if selected_index == 0:
            self.output_format = "string"
        elif selected_index == 1:
            self.output_format = "hex"
        elif selected_index == 2:
            self.output_format = "chart"


if __name__ == '__main__':
    app = QtWidgets.QApplication(sys.argv)
    MainWindow = SerialMonitorApp()
    MainWindow.show()
    sys.exit(app.exec_())
